DADDY!!! I will have Faith in the "Why".... but I will also be looking for you everyday Daddy.... I'm smiling on the outside... but I need you to bring back to me my smile on the inside💞

THANK YOU from the depths of my entire being for ALL the calls, texts, messages, love, sent from so many directions. If you know me.... that means the WORLD!!! and you will know I will never forget how you all loved on me so hard during this time!

THANK you!!! To my 💎 Sister @gblakgal for having your Mommy send a beautiful audio prayer!

And to walk in my Daddy's wake yesterday evening and my Mommy to see the love in the form of beautifully arranged flowers from my dear friends/family from Atlanta just took her breath away!

My Amazing Recession Proof & EYL Family, Our National Board, My Sweet Diamond Sisters, My Brother & Sister Drs. 
Javier & Barbara Johnson... you all touched me and my Mommy so deeply!

