And then.... to have my Rock... my Honey bun tell me to turn around before the Recession and to see that my Brother & Sister.... Marcus & Turq... sitting in the church I grew up in... that I got baptized in at 10 years old... sitting with all our loved ones...I could have dropped to my knees at that very moment! Your love for me over the last couple years is why I have and will always be down💪🏽💙🙏🏽.

🏍  Let's take that "Final Ride" Daddy with your custom Trike leading the way!

Love You Daddy.... Forever...& then Forever Again!

Your Señorita.... Your Daddy's Girl, 
